/* DETECTION_STRATEGY = NOT_EXISTS */
insert /*+ append */ into <?=snpRef.getObjectName("L", "%INT_PRFTRG_CITY", "W") ?> ( CITY_ID, REGION_ID, CITY, POPULATION, IND_UPDATE ) select CITY_ID, REGION_ID, CITY, POPULATION, IND_UPDATE from (
select
TEMP.CITY_ID CITY_ID, SRC_REGION.REGION_ID REGION_ID, TEMP.CITY CITY, TEMP.POPULATION POPULATION,
'I' IND_UPDATE
from (
select
SRC_CITY.CITY CITY, SRC_CITY.CITY_ID CITY_ID, SRC_CITY.POPULATION POPULATION, 24 DATE from <?=snpRef.getObjectName("L", "SRC_CITY", "ORA_SOURCE_ODI", "", "D")?> SRC_CITY, <?=snpRef.getObjectName("L", "SRC_MAP_FAMILY", "ORA_SOURCE_ODI", "", "D")?> SRC_MAP_FAMILY where (1=1) And (SRC_MAP_FAMILY.FAMILY_ID=SRC_CITY.CITY_ID)
) TEMP, <?=snpRef.getObjectName("L", "SRC_REGION", "ORA_SOURCE_ODI", "", "D")?> SRC_REGION where (1=1) And (TEMP.CITY_ID=SRC_REGION.COUNTRY_ID)
) S where NOT EXISTS ( select 1 from <?=snpRef.getObjectName("L", "TRG_CITY", "ORA_TARGET_ODI", "", "D") ?> T where T.CITY_ID = S.CITY_ID and ((T.REGION_ID = S.REGION_ID) or (T.REGION_ID IS NULL and S.REGION_ID IS NULL)) and ((T.CITY = S.CITY) or (T.CITY IS NULL and S.CITY IS NULL)) and ((T.POPULATION = S.POPULATION) or (T.POPULATION IS NULL and S.POPULATION IS NULL)) )

begin
    dbms_stats.gather_table_stats(
	ownname => '<?=snpRef.getInfo("DEST_WORK_SCHEMA") ?>',
	tabname => '<?=snpRef.getObjectName("L", "%INT_PRFTRG_CITY", "W").replaceAll(odiRef.getInfo( "DEST_WORK_SCHEMA" )+".","")?>',
	estimate_percent => dbms_stats.auto_sample_size
    );
end;


/* FLOW CONTROL CREATE INDEX ON THE E$TABLE */
create index 	<?=snpRef.getObjectName("L", "%ERR_PRFTRG_CITY_IDX", "W") ?>
on	<?=snpRef.getObjectName("L", "%ERR_PRFTRG_CITY", "W") ?> (ODI_ROW_ID)

/* DETECTION_STRATEGY = NOT_EXISTS */ insert into <?=snpRef.getObjectName("L", "TRG_CITY", "ORA_TARGET_ODI", "", "D") ?> T ( CITY_ID, REGION_ID, CITY, POPULATION
) select CITY_ID, REGION_ID, CITY, POPULATION
from <?=snpRef.getObjectName("L", "%INT_PRFTRG_CITY", "W") ?> S
where IND_UPDATE = 'I'
